'''
verification of secondary 
structure functionality
'''

def get_dssp_subcategory_scores(sequence, category):
    # function to get a specific subset of the
    # dssp scores. h = helix, c = coil, b = beta sheet

    raw_scores_all = dssp.predict_dssp(sequence,raw_vals=True)

    returned_scores = []

    if category == 'h':
        for subprobs in raw_scores_all:
            returned_scores.append(subprobs[0])
    elif category == 'b':
        for subprobs in raw_scores_all:
            returned_scores.append(subprobs[1])
    elif category == 'c':
        for subprobs in raw_scores_all:
            returned_scores.append(subprobs[2])
    else:
        raise Exception('\n\nplease specify c for coil, h for helix, or b for beta sheet/strand\n')

    return returned_scores


def check_beta_strand(sequence, cutoff=0.7):
    # see if a seq is beta sheet.
    # uses the raw dssp probabilities
    scores = get_dssp_subcategory_scores(sequence, 'b')
    # cut off first amino acid because it's always low for whatever reason
    # also cutoff last amino acid
    scores = scores[1:len(sequence)-1]
    # iterate through sequence
    for aa in scores:
        if aa < cutoff:
            return False
    return True


def check_helicity(sequence, cutoff=0.85):
    # see if a seq is helix.
    # uses the raw dssp probabilities
    scores = get_dssp_subcategory_scores(sequence, 'h')
    # cut off first amino acid because it's always low for whatever reason
    # also cutoff last amino acid
    scores = scores[1:len(sequence)-1]
    # iterate through sequence
    for aa in scores:
        if aa < cutoff:
            return False
    return True


def check_coil(sequence, cutoff=0.85):
    # see if a seq is helix.
    # uses the raw dssp probabilities
    scores = get_dssp_subcategory_scores(sequence, 'c')
    # iterate through sequence
    for aa in scores:
        if aa < cutoff:
            return False
    return True


